import React from 'react';
import './Navigation.css';

const Navigation = () => {
	return (
		<nav style={{display: 'flex', justifyContent: 'flex-end'}}>
			<p className='f3 link dim black pa3 pointer washed-blue'>Sign Out</p>
		</nav>
	);
}

export default Navigation;
